import React from "react";
import PropTypes from "prop-types";


const foodILike = [
  {
    id: 1,
    name: "Kimchi",
    image: "http://img.khan.co.kr/news/2016/12/09/l_2016120901001299800104967.jpg",
    rating: 5
  },
  {
    id: 2,
    name: "Samgyeopsal",
    image: "data:image/jpeg;base64,",
    rating: 3

  },
  {
    id: 3,
    name: "Chicken",
    image: "https://pelicana.co.kr/resources/images/menu/best_menu02_200824.jpg",
    rating: 5


  },
  {
    id: 4,
    name: "Pizza",
    image: "data:image/jpeg;base64,",
    rating: 4

  }

];

function renderFood(dish){
  return <Food 
  key={dish.id} 
  name={dish.name} 
  picture={dish.image} 
  rating={dish.rating}/>
}

function Food({ name, picture, rating }){
  return <div>
   <h1>I like {name}</h1>
   <h4>별점: {rating}/5.0</h4>
   <img src={picture} alt={name}/>
  </div>
 }

Food.propTypes = {
  name: PropTypes.string.isRequired,
  picture: PropTypes.string.isRequired,
  rating: PropTypes.number
}


function App() {
  return (
    <div>
      <h1>hello?</h1>
        {foodILike.map(renderFood)}
    </div>
  );
}

export default App;
